import React, { Component } from 'react';
import LylicBlock from './LylicBlock';

class ResultLylic extends Component {
  constructor(props) {
    super(props);

    const array = this.props.array;
    const listItems = array.map((value, index) => <LylicBlock key={index} value={value} />);
    this.state = {
      list: listItems,
    };
  }

  render() {
    return <div>{this.state.list}</div>;
  }
}

export default ResultLylic;
